import React from 'react';

class Stocklevel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      level: '',
    };
  }

  componentDidMount() {
    fetch(`https://api.nike.com/deliver/available_skus/v1/${this.props.props}`)
      .then((res) => res.json)
      .then((json) => {
        const level = json.level;
        console.log(level);
        this.setState({ level: level });
      });
  }

  render() {
    return <p>{this.state.level}</p>;
  }
}

export default Stocklevel;
